import { Button, FormControl, Grid, Paper, TextField } from '@mui/material';
import Box from '@mui/material/Box';
import "../assets/RegisterPage.css";
export const RegisterPage = () => {
    return (
        <>
            <Box
                sx={{

                    height: "100vh",
                    display: "flex",
                    flexDirection:"column",
                    justifyContent: "center",
                    alignItems: "center",
                }}
            >
                <Box className="register-form"
                sx={{
                    minheight: "500px",
                    minWidth: "600px",
                }}
                >  
                
                <FormControl className='form' variant="standard" sx={{ width: 1, gap: 2, height:"100%" }}>
                <h1 style={{textAlign:"center", color: "blue", fontFamily: "arial"}}> Sign Up To Register </h1>

                    <Grid className='first-form' container sx={{height: "100%",}}>

                    <Grid xs={6} sx={{height:"100%",display: "flex", flexDirection:"column", padding: "40px", gap:2, justifyContent:"space-between"}}>
                    <TextField  label="First Name :" variant="outlined" />
                    <TextField  label="Last Name :" variant="outlined" />
                    <TextField  label="Phone Number :" variant="outlined" />
                    <TextField  label="Address :" variant="outlined" />
                   
                    </Grid>
                    <Grid xs={6} sx={{height:"100%",display: "flex", flexDirection:"column", padding: "40px", gap:2, justifyContent:"space-between"}}>
                    <TextField  label="Email :" variant="outlined" />
                    <TextField  label="Password :" variant="outlined" />
                    <TextField  label="Confirm Password :" variant="outlined" />

                    <Button variant="contained" sx={{height: "50px"}}> Register </Button>
                    </Grid>
                    </Grid>
                </FormControl>
                </Box>
            </Box>
        </>
    )
};
